import "./register.css";
import { Field, Form, Formik } from "formik";
import * as yup from "yup";
import axios from "axios"
import { Link, useNavigate } from "react-router-dom";

const Register = () => {

    const navigate = useNavigate();

    return (
        <div className="register">
            <h1>SignUp</h1>


            <form className="form">
                <input name="name" type="text" placeholder="Name" className="input" required />
                <input name="email" type="email" placeholder="E-mail" className="input" required />
                <input name="password" type="password" placeholder="Password" className="input" required />
                <input name="cpassword" type="password" placeholder="Confirm Password" className="input" required />
                <button type="submit" className="btn">SignUp</button>
            </form>



            <p>Or</p>
            <p>Already a user? <Link to="/login">Login</Link></p>
        </div>
    )
}

export default Register
